Russian-born, New York based artist Svetlana Bailey presents 'Without Kisses and Hugs', a series of never before exhibited large scale, ambitious and experimental photographic works exploring the transformative nature of the human lifecycle and its connection to fruit.

With compelling imagery of lush and decaying fruit evoked as more than just a metaphor for humankind‚Äôs eternal cycles of birth, growth and death, Bailey also draws our attention to the fragile nature of many familiar fruit species, revealing a little known truth that the continued future existence of many fruits are just as threatened by disease and disaster as we have found ourselves to be in 2020.

We share more than sixty-six percent of our DNA with bananas and we have seventy-five percent of DNA that is responsible for disease in common with fruit flies. üçå

These are facts Svetlana Bailey found as background to the fraught imbalances, personal, philosophical and political, between humans and our fragile global ecology ‚Äì with fruit a natural bridge for exposing that increasingly uneasy rupture.

For more information, visit www.artereal.com.au.

